  false,\n\t\"url\": null,\n\t\"notes\": \"The major thrust of wildlife inventory
  on the refuges is towardscensusing waterfowl. During the spring and fall waterfowl,
  baldeagle and cormorant use is based primarily on aerial surveys conductedby personnel
  of the Illinois Natural History Survey. Flights are conducted at mid-winter and
  weekly from March 1 - April 15 and September 1 - December 15. Ground surveys during
  .this period are primarily to pick up species not counted by the aerial surveys,
  such as wood ducks and shorebirds.The procedures outlined in the following plan
  are essentially designedto gain an, idea of what wildlife uses the refuge. Refuge
  staffmembers are expected to record observations made during tasks otherthan censusing,
  especially observations of rarely seen wildlife.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
